    /**
     * Format HTML output from Manana.encode
     * @memberof Manana
     * @method decode
     * @param {string} html - The HTML to be formatted
     */
    this.decode = function(encoded) {
      return String(encoded)
               .replace( /&amp;/g  , '&' )
               .replace( /&quot;/g , '"' )
               .replace( /&\#39;/g , "'" )
               .replace( /&lt;/g   , '<' )
               .replace( /&gt;/g   , '>' );
    }; // end Manana.decode()

